import React from "react";

const books = [
  { title: "The Alchemist", author: "Paulo Coelho" },
  { title: "Atomic Habits", author: "James Clear" },
  { title: "Rich Dad Poor Dad", author: "Robert Kiyosaki" },
  { title: "Wings of Fire", author: "APJ Abdul Kalam" },
];

export default function Catalogue() {
  return (
    <div className="container mt-4">
      <h2 className="text-center mb-4">ðŸ“– Book Catalogue</h2>

      <div className="row d-flex justify-content-center">
        {books.map((book, index) => (
          <div className="card p-3 m-2 shadow" style={{ width: "250px" }} key={index}>
            <h5 className="fw-bold">{book.title}</h5>
            <p className="text-muted">by {book.author}</p>
            <button className="btn btn-outline-primary w-100">View Details</button>
          </div>
        ))}
      </div>
    </div>
  );
}
